                <li>
                    <input type="text" className="form-control" placeHolder="E-mail" />
                </li>
                <li>
                    <input type="password" className="form-control" placeHolder="Password"/>
                </li>
                <li>
                <button type="submit" className="btn btn-warning">Login</button>
                </li>
            </ul>



            </form>
        </div>
    );
};

export default Login;
